##初始化##
import os,sys,time
from selenium import webdriver
import selenium
##初始化调试日志
import logging 
logging.basicConfig(
    level=logging.DEBUG, #日志级别，默认为logging.WARNING,日志级别的关系为：CRITICAL》ERROR》WARNING》INFO》DEBUG》NOTEST
)
items=['']
companies=data
url='http://qichacha.com/search?key={0}&province={1}&p={2}&index='
output=[]
path = os.path.abspath(os.path.dirname(sys.argv[0]))
chromedriver =path + '\\chromedriver.exe'
if os.name=='posix':
    chromedriver='/usr/local/share/chromedriver'
logging.info([chromedriver])
os.environ["webdriver.chrome.driver"] = chromedriver
option = webdriver.ChromeOptions()#自定义设置
if os.name =='nt':
    option.add_argument('--user-data-dir=' + os.getenv('APPDATA') + '\\..\\Local\\Google\\Chrome\\User Data')
else:
    option.add_argument('--user-data-dir=/home/yao/.config/google-chrome')
#设置成用户自己的数据目录##注意退出当前的chrome
option.add_argument('--user-agent=Mozilla/5.0 (Linux; U; Android 2.2.1; zh-cn; HTC_Wildfire_A3333 Build/FRG83D) AppleWebKit/533.1 (KHTML, like Gecko) Version/4.0 Mobile Safari/533.1') #修改浏览器的User-Agent来伪装你的浏览器
option.add_argument('--process-per-site') #每个站点使用单独进程
option.add_argument('--lang=zh-CN') #设置语言为简体中文
##完成初始化##
driver = webdriver.Chrome(chromedriver,chrome_options=option)
driver.get('about:version')
time.sleep(2)
driver.get('http://qichacha.com/user_login')
time.sleep(1)
item=items
i=''
##fuck
while i=='':
    for company in companies:
        try:
            driver.get(url.format(company,item[0],i))
            time.sleep(1)
            driver.find_element_by_xpath(str('/html/body/div[1]/div/div[3]/section/div[3]/form/div/span/input')).click()
            time.sleep(10)
        except selenium.common.exceptions.NoSuchElementException as err:
            try:
                driver.find_element_by_xpath(str('/html/body/div[1]/div/div[3]/div[1]/span/a')).click()
                time.sleep(10)
            except selenium.common.exceptions.NoSuchElementException as err:
                logging.info(['All no found',err])
        except KeyboardInterrupt:
            logging.info('exit')
            i=0
            break
        except BaseException as err:
            logging.warning([err])
        finally:
            logging.info(company)
            time.sleep(1)
